import React from "react";
import "./Menuitems.css";

const menus = [
    { 
        name: "키워드 분석 / 카테고리 현황", 
        path: "/manage", 
        cName: "nav-links"
    },
    //{ name: "제품 키워드", path = "/product-key"},
    //{ name: "대량 키워드 검색", path = "/mass-search"}
];


function Menuitems({menu}){
    return (
        <div className = "menu-item">
            <p>{menu.name}</p>
        </div>
    );
}

export default Menuitems;
